// Call the correct server shim based on method unique ID.
erpc_status_t rpc_wifi_mdns_service::handleInvocation(uint32_t methodId, uint32_t sequence, Codec * codec, MessageBufferFactory *messageFactory)
{
    switch (methodId)
    {
        case krpc_wifi_mdns_rpc_mdns_init_id:
            return rpc_mdns_init_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_free_id:
            return rpc_mdns_free_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_service_add_id:
            return rpc_mdns_service_add_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_service_remove_id:
            return rpc_mdns_service_remove_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_service_txt_item_set_id:
            return rpc_mdns_service_txt_item_set_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_service_instance_name_set_id:
            return rpc_mdns_service_instance_name_set_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_instance_name_set_id:
            return rpc_mdns_instance_name_set_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_hostname_set_id:
            return rpc_mdns_hostname_set_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_a_id:
            return rpc_mdns_query_a_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_ptr_id:
            return rpc_mdns_query_ptr_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_ptr_result_basic_id:
            return rpc_mdns_query_ptr_result_basic_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_ptr_result_txt_id:
            return rpc_mdns_query_ptr_result_txt_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_ptr_result_addr_id:
            return rpc_mdns_query_ptr_result_addr_shim(codec, messageFactory, sequence);

        case krpc_wifi_mdns_rpc_mdns_query_results_free_id:
            return rpc_mdns_query_results_free_shim(codec, messageFactory, sequence);

        default:
            return kErpcStatus_InvalidArgument;
    }
}

